import logo from "./logo.svg";
import Navigation from "./components/navigation.jsx";
import ImageLinkForm from "./components/imageLinkForm.jsx";
import Rank from "./components/Rank.jsx";
import Particles from "react-particles-js";
import "tachyons";
console.log(document.clientX);

function App() {
  const onInputChange = (e) => {
    console.log(e.target);
  };
  return (
    <div className="App">
      <Particles
        className="background"
        params={{
          particles: {
            number: {
              value: (window.innerHeight * window.innerWidth) / 10000,
            },
            size: {
              value: 3,
            },
          },
          interactivity: {
            events: {
              onclick: {
                enable: true,
                mode: "repulse",
              },
            },
          },
        }}
      />
      <Navigation />
      <Rank />
      <ImageLinkForm onChange={this.onInputChange} />
    </div>
  );
}

export default App;
